INSERT INTO `tickets` VALUES (1,1,1,'413230','Atualização do módulo Pagar.me','O cliente relatou que os pedido feito em sua loja pelo o método de pagamento Boleto Bancário da Pagar.me, não estavam  sendo atualizado o status do pedido na loja, quando a Pagar.me o notificava de que o pagamento tinha sido pago. E por isso, os pedidos estavam sendo cancelado por falta de verificação.','Foi instalado a versão mais atual do módulo Pagar.me','Resolvido','Baixa',NULL,'2024-03-25 16:43:19','2024-04-02 17:14:49'),(2,1,1,'412808','Atualização de status de pagamento Mercado Pago','O pedido esta com o pagamento Aprovado nas Informações de Pagamento, no comentário histórico também apareceu a atualização que o pedido atualizou para processando, mas o status do pedido permanece como pendente.','Segue o ajuste na atualização do status do pedido após o processamento da notificação recebida pela  a Mercado Pago.','Resolvido','Baixa',NULL,'2024-03-26 11:42:27',NULL),(3,1,1,'413269','Atualização do módulo Pagar.me','O cliente relata que os pedidos estão sendo aprovados no lado da Pagar.me mas o site não esta mudando o status para a integração ocorrer.','Foi feito a atualização do módulo.','Resolvido','Baixa',NULL,'2024-03-26 12:17:45','2024-04-02 17:14:59'),(4,3,3,'413284','Instalar o módulo da Frenet ','Instalar o módulo da Frenet na loja','','Resolvido','Baixa',NULL,'2024-03-26 14:09:21','2024-04-02 17:15:15'),(5,1,4,'413293','Instalação do módulo GA4','O cliente solicitou a instalação do módulo GA4','Foi instalado a versão mais atualizada do módulo.\r\n\r\nRepositório: https://git2bis.com.br/bis2bis/m1/modulos/dev-tools/google/google-analytics/-/tree/1.1.0?ref_type=tags','Resolvido','Baixa',NULL,'2024-03-26 17:53:59','2024-04-02 17:15:28'),(6,4,5,'413292','Atualizar do módulo Pagar.me','O checkout da loja não está  finalizando o pedido e por isso o cliente solicitou a atualização do módulo da pagar.me.','Foi instalado a versão mais atual do módulo','Resolvido','Baixa',NULL,'2024-03-26 19:01:15',NULL),(7,5,6,'413307','Instalação do módulo GA4','O cliente  solicitou a instalação do módulo','Instalado a versão mais atual do módulo.\r\n\r\nRepo: https://git2bis.com.br/bis2bis/m1/modulos/dev-tools/google/google-analytics/-/tree/1.1.0?ref_type=tags','Resolvido','Baixa',NULL,'2024-03-27 18:18:34',NULL),(8,5,8,'413433','Instalação do módulo GA4','Por gentileza, poderiam instalar o módulo: Módulo GA4, mesmo instalado na loja Good Pufes','Instalado a versão mais atualo do módulo GA\r\n\r\nRepo: https://git2bis.com.br/bis2bis/m1/modulos/dev-tools/google/google-analytics/-/tree/1.1.0?ref_type=tags','Resolvido','Baixa',NULL,'2024-03-27 18:26:15','2024-04-02 17:14:39'),(9,1,9,'413034','Banner home não exibi em mobile','O cliente se queixa de que o banner da página home não está aparecendo no display Mobile.','No momento em que eu assumi o ticket, eu somente limpei os caches da loja, Redis e CDN, e o banner voltou a aparecer.','Resolvido','Baixa',NULL,'2024-03-22 18:51:21',NULL),(10,1,10,'413182','Atualização do módulo Pagar.me','O cliente relata que os pedidos pago via boleto Pagar.me não estão  sendo integrados na loja, e por isso alguns pedidos não estão sendo atualizados automática mente e precisam ser atualizados manualmente.','Foi atualizado o módulo para a versão mais atual.','Resolvido','Baixa',NULL,'2024-03-22 19:34:26',NULL),(11,1,11,'413007','Instalação do módulo Pagar.me','O cliente relata que os clientes fizeram pedido por boleto, o mesmo foi pago o valor mas não caiu para a loja.','Foi instalado a última versão do módulo Pagar.me','Resolvido','Baixa',NULL,'2024-03-21 19:42:00',NULL),(12,1,12,'412902','Integração de boletos aprovados junto a PagarMe','O cliente relata que os pedidos pagos via boleto Pagar.me não estão atualizando o status do pedido na loja.','Atualizado o módulo para última versão.','Resolvido','Baixa',NULL,'2024-03-27 19:49:08',NULL),(13,3,8,'413402','Instalação do módulo Pagar.me','Os pedidos com pagamento em boleto estão aparecendo como pagos na plataforma da pagar.me, porém não estão aparecendo como pagos na plataforma do Magento, gostaria que verificassem a comunicação entre a plataforma de pagamentos.','Foi atualizado o módulo de pagamento Pagar.me','Resolvido','Baixa',NULL,'2024-03-28 12:28:50','2024-04-02 17:14:32'),(14,4,14,'412922','Atualização do módulo Pagar.me','Mesmo após a atualização os pedidos ainda não estão atualizando o status de forma automática. ','Foi atualizado o módulo para a versão mais atual.','Resolvido','Média',NULL,'2024-04-01 11:07:09','2024-04-02 17:14:22'),(15,6,15,'413208','Instalação do módulo Pagar.me','Olá prezados,\r\nPor gentileza, poderiam verificar a demanda abaixo:\r\nOrçar a instalação e configuração do módulo da pagar.me na loja \r\n','','Resolvido','Baixa',NULL,'2024-04-01 17:09:25','2024-04-02 17:14:09'),(16,1,16,'413087','Fornecimento dos endpoints para atualização do estoque','Cria um exemplo de requisição usando o método stockInventoryUpdate e o catalogProductUpdate atualizando o estoque de um produto e envia o exemplo anexo nesse ticket. Coloque também uma evidencia mostrando que a atualização de estoque ocorreu corretamente.','Segue em anexo o XML dos endpoints catalogInventoryStockItemUpdate e catalogProductUpdate, que são responsáveis por atualizarem a quantidade dos produtos em estoque.','Resolvido','Baixa',NULL,'2024-04-01 19:53:08',NULL),(17,1,18,'412772','Instalação do módulo XML Facebook','Por gentileza, poderia realizar a instalação do módulo do Facebook XML API.','Foi atualizado o módulo do Facebook XML para última versão do momento.','Resolvido','Baixa',NULL,'2024-04-01 19:58:05',NULL),(18,4,17,'413579','Atualizar módulo GA4','Por gentileza, atualizar o módulo do GA4 na loja.\r\nLoja com a versão mais atualizada: https://www.livrariasfamiliacrista.com.br/','O módulo foi atualizado para a última versão mais atual do  momento.','Resolvido','Baixa',NULL,'2024-04-02 11:38:51',NULL),(19,4,13,'413439','Instalação do módulo E-rede','Por gentileza, instalar o módulo da Rede na loja.','Instalado o módulo e encaminhado para o time QA para validação.','Resolvido','Baixa',NULL,'2024-04-02 11:42:00','2024-04-16 19:51:05'),(20,5,8,'413604','Instalação do módulo Pag Hiper','Olá prezados, \r\nPor gentileza, poderiam instalar o módulo: PagHiper completo\r\nBoleto e Pix.','As modalidades de Pix e Boleto Bancário, estão na  branch:  dev-feature/pix_method-EV-3094','Resolvido','Baixa',NULL,'2024-04-02 11:50:28','2024-04-02 17:13:40'),(21,7,13,'413651','Instalação do módulo Restrição de Pagamento','Bom dia,\r\npor favor instalar o módulo abaixo na loja de HOMOLOGAÇÂO. \r\n\r\nRepo: https://git2bis.com.br/bis2bis/m2/modulos/payment-tools/payment-restrictions','Instalado o módulo na versão: dev-develop.','Resolvido','Baixa',NULL,'2024-04-02 14:44:01','2024-04-02 17:18:33'),(23,4,19,'413592','Atualização do módulo Cielo v3','Estamos mudando de maquineta para cielo na perfatta, e quero socilitar uma mudança de metodo de pagamento para cielo tbm (Perfatta)','Foi instalado a versão master do módulo.\r\nRepo: https://git2bis.com.br/bis2bis/bis2bis-modules/bitbucket-modules/cielo-v3 ','Resolvido','Baixa',NULL,'2024-04-02 19:22:11','2024-07-24 17:42:16'),(24,4,22,'413618','Instalação do módulo Jadlog v2','Boa tarde, tudo bem?\r\nPor gentileza, instalar o módulo da Jadlog V2  na loja. ','Foi instalado a última atualização do módulo(development).','Resolvido','Baixa',NULL,'2024-04-03 13:24:38','2024-04-03 16:40:19'),(25,3,23,'413646','Instalação do módulo Autenticação de 2 fatores','Bom dia, por gentileza instalar o módulo na loja.','','Resolvido','Baixa',NULL,'2024-04-03 16:42:30','2024-04-03 20:47:02'),(26,1,5,'412928','Instalação do módulo Pagar.me','Bom dia!\r\nPessoal, nosso site não esta pegando os retornos dos pagamentos via boleto do pagarme - conseguem verificar?','Foi atualizado o módulo com  a última versão atualizada do módulo.','Resolvido','Baixa',NULL,'2024-04-19 16:50:54',NULL),(28,1,25,'412936','Instalação do módulo Pagar.me','Bom dia!\r\nUm cliente efetuou o pagamento de um boleto, na pagar.me está ok, o boleto caiu. Porem em nosso site consta como pendente ainda, acredito que esteja com problema na integração.','Foi  feito a atualização do módulo.','Resolvido','Baixa',NULL,'2024-04-19 17:15:41',NULL),(29,1,26,'412619','Instalação do módulo Google Merchant','Olá time!\r\nPoderiam instalar o modulo do Google Merchant igual ao da cia pneus','Instalado  o módulo.','Resolvido','Baixa',NULL,'2024-04-18 17:25:35',NULL),(30,1,27,'412855','Exibição da home page ao salvar promoção',' Ao tentar criar uma promoção, dentro de ações aparece a home da loja, mesmo apertando f5 não atualiza nem desloga do painel','Boa tarde equipe!\r\nForam realizadas alguns testes no ambiente de produção e não foi possível reproduzir o mau comportamento relatado pelo cliente na configuração/atualização na regra de promoção do carrinho de compras, como mostra a evidência abaixo.\r\n\r\n \r\n\r\nNos testes realizados, foram testados os seguintes cenários:\r\n\r\nCriação de uma nova regra de promoção.\r\n- Edição da regra de promoção\r\n- Limpeza de cache Redis e CDN\r\n\r\nContudo, sugiro que monitore essa loja para ver se o mesmo comportamento volta acontecer.','Resolvido','Baixa',NULL,'2024-04-18 17:51:29',NULL),(31,2,28,'412696','Atualização do módulo Pagar.me','Bom dia equipe, tudo bem?\r\n\r\nPor gentileza, poderia realizar a atualização no módulo do método de pagamento Pagar-me.\r\n\r\nConforme esta sendo aplicado na loja https://www.astrodistribuidora.com/ atraves do ticket 412340.','Módulo já  instalado','Resolvido','Baixa',NULL,'2024-04-03 17:59:07',NULL),(32,3,29,'412668','Instalar módulo Bloqueio de Compras','Boa tarde, por gentileza, poderia instalar o módulo \'Bloqueio de Compras\' na loja','Feito','Resolvido','Baixa',NULL,'2024-04-03 20:38:22',NULL),(33,2,30,'412695','Instalação da funcionalidade Pix PagSeguro','Boa tarde equipe, tudo bem?\r\nPoderiam instalar p PIX do PagSeguro na loja