 coisa, o jeito foi remover a regra validate-dob das regras do campos.','Resolvido','Baixa',NULL,'2024-04-12 20:41:42','2024-04-17 18:04:15'),(60,2,41,'414237','Atualização do método de pagamento Pagar.me','Bom dia equipe, tudo bem?\r\n\r\nPor gentileza, poderia realizar a atualização no módulo do método de pagamento Pagar-me.','Atualizado como a última versão do módulo.','Resolvido','Baixa',NULL,'2024-04-17 18:09:15',NULL),(61,3,42,'414313','Orçamento de instalação da modalidade Pix do Mercado Pago','Bom dia,\r\npor gentileza orçar o módulo do mercado pago para PIX','','Resolvido','Baixa',NULL,'2024-04-17 19:12:49','2024-04-18 21:59:36'),(62,4,43,'414194','Falha na exibição dos produtos relacionados há categoria.','{\"ops\":[{\"insert\":\"Bom dia Equipe! Descrição da Falha: Dentro do cadastro do produto, na aba \\\"Categorias\\\" não esta sendo exibido as categorias cadastradas. Passos Tomados até o Momento: Já conferi o cadastro de categorias, e esta correto.\\n\"}]}','{\"ops\":[{\"insert\":\"Boa tarde equipe! \\n\\nSegue o ajuste da apresentação das categorias, no detalhes do produto, no painel administrativo. Será necessário executar uma instrução SQL no banco de dados da loja em produção, onde será corrigido a configuração da categoria raiz. \\n\\nA instrução SQL se encontra abaixo: \\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"UPDATE catalog_category_entity SET children_count=ABS(children_count) WHERE entity_id = 1277\"},{\"insert\":\"\\n\"}]}','Resolvido','Baixa',NULL,'2024-04-17 19:24:54','2024-04-20 16:44:50'),(65,4,48,'414599','Limpeza dos dados do módulo Anymarket','Bom dia, tudo bem?\r\nPor gentileza, podem me auxiliar na exclusão do produto dentro do módulo da AnyMarket? Este produto foi excluído dentro do painel da Any e agora está causando conflito, não sendo possível desativá-lo daqui. ','Foi necessário executar um comando no banco de dados, como relatado no ticket e solicitado na task: https://bis2bis-jira.atlassian.net/browse/INFRA-3473','Res