upom não está sendo exibido','{\"ops\":[{\"insert\":\"Olá Equipe, Bom dia!\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Descrição do Problema: \"},{\"insert\":\"A loja tem a funcionalidade de gerar cupons automaticamente nas \\\"regras de preço\\\". No entanto, ao selecionar a opção \\\"Usar Geração Automática\\\", o código do cupom não está sendo exibido.\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Relato do Cliente: \"},{\"insert\":\"Nós costumávamos usar a geração automática de código de cupom para vales-presentes. Mas faz um tempo que isso parou de funcionar.\\nQuando fazemos a solicitação o site devolve a mensagem anexa e nada acontece.\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Ação Necessária: \"},{\"insert\":\"Corrigir para que quando selecione a opção de \\\"Usar Geração Automática\\\" o sistema gere um código de cupom.\\n\"}]}','{\"ops\":[{\"insert\":\"Após analisar o mau comportamento, identifiquei que o motivo pelo o qual os cupons não estarem sendo gerados automaticamente era devido há um problema no serviço de execução das filas da loja. Onde foi criado um serviço personalizado para serem processados essas mensagens na fila quando forem requisitadas.\\n\"}]}','Resolvido','Baixa',NULL,'2024-12-03 17:08:15','2024-12-05 16:53:27'),(306,3,57,'427913','Instalação do módulo Custom URL Rewrite Management','{\"ops\":[{\"insert\":\"Olá, bom dia!\\n\\nPor gentileza instalar o módulo na loja?\\n\"}]}','{\"ops\":[{\"insert\":\"Deploy: \"},{\"attributes\":{\"link\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/lemonpaper/-/commit/fc16f6339aa69e0a8dcf7114a8d93a77fd977a2a\"},\"insert\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/lemonpaper/-/commit/fc16f6339aa69e0a8dcf7114a8d93a77fd977a2a\"},{\"insert\":\"\\n\"}]}','Resolvido','Baixa',NULL,'2024-12-06 08:30:52','2024-12-06 11:58:07'),(307,1,173,'428059','Destravar processo de exportação de dados via shell','{\"ops\":[{\"insert\":\"Olá bom dia!\\nPoderia ajustar, está travando o rel