-09 13:47:02'),(329,4,154,'429101','Busca e Newsletter - Campos em branco','{\"ops\":[{\"insert\":\"Olá Equipe, Bom dia!\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Descrição do Problema:\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Busca com espaços em branco:\"},{\"insert\":\"\\nAo realizar uma busca contendo apenas espaços em branco, é exibida uma tela de erro. \"},{\"attributes\":{\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Newsletter | Campo de nome em branco:\"},{\"insert\":\"\\nAtualmente, ao enviar o campo de nome contendo apenas espaços em branco, ele é exibido uma mensagem de erro no topo da página. Por gentileza, ajustar o comportamento para que seja semelhante ao do campo de e-mail, onde, ao estar vazio, retorna um tooltip informando que o campo não pode ficar em branco.\"},{\"attributes\":{\"list\":\"bullet\"},\"insert\":\"\\n\"}]}','{\"ops\":[{\"insert\":\"Deploy: \"},{\"attributes\":{\"link\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/biohervas/-/commit/b79b16e765c4edd2440771b736733786a8a95ec8\"},\"insert\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/biohervas/-/commit/b79b16e765c4edd2440771b736733786a8a95ec8\"},{\"insert\":\"\\n\"}]}','Resolvido','Baixa',NULL,'2025-01-09 15:12:46','2025-01-10 09:24:19'),(330,1,192,'429143','Instalação do método de pagamento Frenet','{\"ops\":[{\"insert\":\"Olá time!\\n\\nPoderia instalar a Frenet Shipping na loja por gentileza?\\n\"}]}','{\"ops\":[{\"insert\":\"Deploy: \"},{\"attributes\":{\"link\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/damatacafe/-/commit/606eaa14ebfd3487fe617bcd50b6e87ee54a6385\"},\"insert\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/damatacafe/-/commit/606eaa14ebfd3487fe617bcd50b6e87ee54a6385\"},{\"insert\":\"\\n\"}]}','Resolvido','Média',NULL,'2025-01-10 09:08:43','2025-01-10 14:18:12'),(331,4,154,'429113','Aplicação de desconto Oferta Relâmpago aplicando incorreto','{\"ops\":[{\"insert\":\"Olá Equipe, Bom dia!\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Descrição do Problema:\"},{\"insert\":\" Na funcionalidade de Oferta Relâmpago, ao configurarmos um valor de desconto (por exemplo, 5%), o sistema está aplicando o desconto de forma incorreta. Em vez de aplicar os 5% de desconto, ele está aplicando o valor oposto, ou seja, 95% de desconto, o que gera um erro no cálculo do preço final.\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Ação Necessária:\"},{\"insert\":\" O desconto deve ser aplicado de acordo com o que foi inserido.\\n\\nO desconto deve ser aplicado de acordo com o valor inserido, ou seja, o percentual de desconto configurado deve ser corretamente calculado e subtraído do preço original.\\n\"}]}','{\"ops\":[{\"insert\":\"Boa tarde equipe!\\n\\nO comportamento descrito na regra de desconto da loja é devido a  configuração da regra, eu analisei as configurações e na aba Ações, o campo Aplicar estava com o valor \\\"Valor  Percentual  % no Preço Final\\\" setado que a opção correta seria o \\\"Valor Percentual % no Preço do Produto\\\", habilitando essa opção a regra de desconto assumiu o comportamento esperado.\\n\"}]}','Resolvido','Baixa',NULL,'2025-01-10 14:24:15','2025-01-10 16:46:17'),(332,3,193,'429147','Instalação do módulo Intelipost','{\"ops\":[{\"insert\":\"Bom dia Time!\\n\\npor gentileza instalar o módulo da intelipost na loja.\\n\"}]}','{\"ops\":[{\"insert\":\"Deploy: \"},{\"attributes\":{\"link\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/syma/-/commit/d121e96fb692ff2d0678ea2b64f2c7d9941dca91\"},\"insert\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/syma/-/commit/d121e96fb692ff2d0678ea2b64f2c7d9941dca91\"},{\"insert\":\"\\n\"}]}','Resolvido','Baixa',NULL,'2025-01-10 17:00:01','2025-01-13 09:46:56'),(333,3,194,'429160','Instalação do módulo Pagbank','{\"ops\":[{\"insert\":\"Bom dia time\\n\\npor gentileza, instalar o módulo da Pagbank na loja.\\n\"}]}','{\"ops\":[{\"insert\":\"Deploy: \"},{\"attributes\":{\"link\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/alternativa-foto-produto/-/commit/557e9b75ee26c9b72a733acab2e65958d16a36cb\"},\"insert\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/alternativa-foto-produto/-/commit/557e9b75ee26c9b72a733acab2e65958d16a36cb\"},{\"insert\":\"\\n\"}]}','Resolvido','Baixa',NULL,'2025-01-13 09:52:13','2025-01-13 14:20:19'),(334,2,195,'429225','Instalação do módulo de Autenticação de Dois Fatores','{\"ops\":[{\"insert\":\"Bom dia equipe, tudo bem?\\nPor gentileza instalar o módulo de autenticação de dois fatores na loja.\\n\"}]}','{\"ops\":[{\"insert\":\"Deploy: \"},{\"attributes\":{\"link\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/pitoni-pneus/-/commit/9a98f5cc67e772df34a62159a90da9e60c772359\"},\"insert\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/pitoni-pneus/-/commit/9a98f5cc67e772df34a62159a90da9e60c772359\"},{\"insert\":\"\\n\"}]}','Resolvido','Baixa',NULL,'2025-01-13 14:48:24','2025-01-13 17:23:57'),(335,3,2,'428518','Ajustar no posicionamento do selo Maior Durabilidade','{\"ops\":[{\"insert\":\"@\"},{\"attributes\":{\"bold\":true},\"insert\":\"Allysson Yamazaki\"},{\"insert\":\"\\nBom dia Kelly.\\nOk, obrigado.\\nComo mencionei, so quis deixar avisado que, o modo como foi desenvolvido o modulo pela equipe de back, aquela função de movimentar a tag dentro do quadro não esta funcional. Seria necessário a analise da equipe para correção. \\n\\n@\"},{\"attributes\":{\"bold\":true},\"insert\":\"Allysson Yamazaki\"},{\"insert\":\"\\nBoa tarde.\\nApenas como aviso!\\nO modulo SELOS nao esta de acordo com as funções relacionadas a posição editável. Para deixar a tag como o lojista desejava, foi utilizado edição de classes e css para ajuste. Provavelmente inserindo outra nova tag no lugar dessa alterada, poderá ocorrer erros de posicionamento como estava anteriormente.\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"@Samuel Neuman\"},{\"insert\":\"\\nBom dia!\\nPreciso que o selo criado (maior durabilidade) fique na parte de baixo do produto.\\n\"}]}','{\"ops\":[{\"insert\":\"O simulador estava funcionando, só precisava limpar os caches\\n\"}]}','Resolvido','Baixa',NULL,'2025-01-14 10:42:01','2025-01-15 10:33:20'),(336,4,102,'429317','Instalação do módulo de Exportação de Planilha via Shell','{\"ops\":[{\"insert\":\"Olá, boa tarde time!\\n\\nPor gentileza instalar o módulo de exportação via shell na loja.\\n\"}]}','{\"ops\":[{\"insert\":\"Deploy: \"},{\"attributes\":{\"link\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/kinghouse-bisws/-/commit/7ce6776aa6e686847275ea410e4333fb3270018c\"},\"insert\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/kinghouse-bisws/-/commit/7ce6776aa6e686847275ea410e4333fb3270018c\"},{\"insert\":\"\\n\"}]}','Resolvido','Baixa',NULL,'2025-01-15 13:58:02','2025-01-15 14:27:21'),(337,1,72,'429340','Instalação do módulo Melhor Envio','{\"ops\":[{\"insert\":\"Olá equipe!\\n\\nPoderia instalar o módulo na loja, por gentileza?\\n\"}]}','{\"ops\":[{\"insert\":\"Deploy: \"},{\"attributes\":{\"link\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/bellenzier/-/commit/16332701bd3cb1fedd7deb09d631c102fe4af4a2\"},\"insert\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/bellenzier/-/commit/16332701bd3cb1fedd7deb09d631c102fe4af4a2\"},{\"insert\":\"\\n\"}]}','Resolvido','Baixa',NULL,'2025-01-15 14:30:23','2025-01-15 17:05:52'),(338,4,26,'429319','Instalação do módulo Omny Checkout','{\"ops\":[{\"insert\":\"Olá time!\\n\\nPor gentileza, instalar o módulo da Omny na loja Bisws.\\n\"}]}','{\"ops\":[{\"insert\":\"Deploy: \"},{\"attributes\":{\"link\":\"https://git2bis.com.br/bis2bis/m2/lojas/cama-in-box/-/commit/2721b74a9eb57c2e979c849291b9d5896646baa1\"},\"insert\":\"https://git2bis.com.br/bis2bis/m2/lojas/cama-in-box/-/commit/2721b74a9eb57c2e979c849291b9d5896646baa1\"},{\"insert\":\"\\n\"}]}','Resolvido','Baixa',NULL,'2025-01-16 09:21:23','2025-01-21 08:23:31'),(339,1,81,'429347','Instalação dos módulos: Webp e Login Social','{\"ops\":[{\"in