ortamento de verificação da disponibilidade do produto em estoque, é passivo de orçamento pois entende-se que esse comportamento se trata de uma melhoria na loja. \\n\\nO @Eduardo Sanches está á par da situação.\\n\\nNo mais, fico á disposição.\\n\"}]}','Resolvido','Baixa',NULL,'2025-01-22 16:01:15','2025-01-27 11:15:12'),(348,4,18,'429659','Instalar a funcionalidade Gerenciar Status','{\"ops\":[{\"insert\":\"Olá, time.\\n\\nPor gentileza, podem incluir a aba de gerenciar status dentro da aba de pedidos no painel admin?\\n\"}]}','{\"ops\":[{\"insert\":\"Deploy: \"},{\"attributes\":{\"link\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/mult-comercial/-/commit/b33d2fb541dcd5e3c1ecf3e2dd3367e2545553db\"},\"insert\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/mult-comercial/-/commit/b33d2fb541dcd5e3c1ecf3e2dd3367e2545553db\"},{\"insert\":\"\\n\"}]}','Resolvido','Baixa',NULL,'2025-01-23 14:39:37','2025-01-23 15:00:54'),(349,4,72,'429596','Instalação do módulo Custom URL','{\"ops\":[{\"insert\":\"Olá, time.\\n\\nPor gentileza, podem instalar a opção de \"},{\"attributes\":{\"bold\":true},\"insert\":\"Custom URL Rewrite Management \"},{\"insert\":\"na loja.\\n\"}]}','{\"ops\":[{\"insert\":\"Deploy: \"},{\"attributes\":{\"link\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/bellenzier/-/commit/bbe1b85a710fc40228f9fdc04fa7412548ead42c\"},\"insert\":\"https://git2bis.com.br/bis2bis/bis2bis-stores/bellenzier/-/commit/bbe1b85a710fc40228f9fdc04fa7412548ead42c\"},{\"insert\":\"\\n\"}]}','Resolvido','Baixa',NULL,'2025-01-23 15:31:08','2025-01-23 15:53:02'),(350,2,152,'429535','Instalação do módulo Melhor Envio','{\"ops\":[{\"insert\":\"Bom dia equipe, tudo bem?\\n\\nPor gentileza, poderia instalar na loja o módulo de entrega do melho encio confome a loja \"},{\"attributes\":{\"link\":\"https://www.bellenzier.com.br/\"},\"insert\":\"https://www.bellenzier.com.br/\"},{\"insert\":\"\\n\"}]}','{\"ops\":[{\"insert\":\"Deploy: \"},{\"attributes\":{\"link\":\"https://git2bis.com